} impl Future for SleepFuture { type Output = (); fn poll( self: std::pin::Pin<&mut Self>, cx: &mut std::task::Context<'_>, ) -> Poll<Self::Output> { // Remember to call waker.wake() when the future is ready let waker = cx.waker().clone(); // If SleepFuture is Unpin we can simply grab a &mut ref here let self_mut_ref = self.get_mut(); // ANCHOR_END: lab_pre if self_mut_ref.completion_time <= Instant::now() { return Poll::Ready(()); } let duration = self_mut_ref.completion_time - Instant::now(); std::thread::spawn(move || { std::thread::sleep(duration); waker.wake(); }); Poll::Pending // ANCHOR: lab_post }
