What if perform takes a while to compute and we have other operations we would like to perform? One way to solve this is to use threading, and there are lots of ways to do this. For example if your program has embarrassingly parallelizable work, rayon may be a good fit. A really simple way to this might be to simply spawn the work in a thread: fn perform_callback<F>(input: String, callback: F) where F: FnOnce(String) + Send + 'static
{ std::thread::spawn(move || { callback(format!("Performed {}", input.as_str())) });
} Or with rayon's threadpools: fn perform_callback<F>(input: String, callback: F) where F: FnOnce(String) + Send + 'static
{ rayon::spawn(move || { callback(format!("Performed {}", input.as_str())) });
}

